n, a, b, p, q = list(map(int, input().split()))

dp = [[0] * (n + 1) for i in range(a + 1)]
dp[0][0] = 0

for i in range(1, n + 1):
	for j in range(1, i + 1):
		if j % a == 0:
			dp[i][j] = dp[i - 1][j - 1] + 1
		elif j % b == 0:
			dp[i][j] = dp[i - 1][j - 1] + 2
		else:
			dp[i][j] = dp[i - 1][j - 1]

print(sum(dp[a]))
